class AuthService {
  constructor(http) {
    this.http = http;
  }

  async signUp(email, password, name) {
    const data = this.http.fetch('/auth/signup', {
      email,
      password,
      name,
    });
    console.log(data);
  }

  async login(email, password) {
    const user = this.http.fetch('/auth/login', {
      email,
      password,
    });
    console.log(user);
  }

  async logout() {
    return this.http.fetch('/auth/logout', {
      method: 'POST',
    });
  }

  async csrfToken() {
    const resp = await this.http.fetch('/auth/csrf-token', {
      method: 'GET',
    });
    return resp.csrfToken;
  }
}

export default AuthService;
